import React, {useContext} from 'react';
import Item from "./Item";
import Button from "../UI/ Button/Button";
import {OrderContext} from "../../context/OrderContext";

const Order = ({order}) => {
    const {orderId, setOrderId} = useContext(OrderContext);
    const clickHandler = () => {
        setOrderId(order.id);
        //console.log('Selected Order Id From Orders: ', orderId)
    }

  return (
      <div className="order-element">
          <div>{order.id} - {order.status}</div>
          <Button title="Use this Order" clickHandler={clickHandler} />
      </div>
  );
}

export default Order;
